jQuery(document).ready(function(o){wp.customize("bric[carousel][transition]",function(e){e.bind(function(e){"slide"==e?o(".carousel").removeClass("carousel-fade"):"fade"==e&&o(".carousel").addClass("carousel-fade")})}),wp.customize("bric[carousel][speed]",function(e){e.bind(function(e){o(".carousel").carousel("dispose"),o(".carousel").carousel({interval:e})})})});